import './App.css';
import {BrowserRouter,Routes,Route} from "react" 
import booking from './components/booking';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path="/booking" element={booking}/>
      </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
